import actions from './actions';
import getters from './getters';
import mutations from './mutations';

const state = {
    searchValue: ''
};

const moduleStore = {
    namespaced: true,
    state,
    actions,
    getters,
    mutations,
}
const moduleName = 'Dashboard'

export {
    moduleStore , moduleName
};
